(20, 7, 2, 0, 0, 1, 1, 0, 'Page', '2019-01-16 20:15:48', '2019-01-16 20:12:53', 'Inherit', 'Inherit', 'verein', 'Verein', NULL, '<h2>√úber uns</h2><p>Der Verein \"Streunerkatzen O√ñ - Verein zum Schutz verwilderter Katzen\" wurde am 17.08.2006 gegr√ºndet.</p><p>Streunerkatzen sind f√ºr viele Menschen wie Ratten oder Tauben, sprich Ungeziefer und somit nicht erw√ºnscht. Die meisten Katzen jedoch stammen vorwiegend von Bauernh√∂fen oder ausgesetzten, unkastrierten Katzen ab.<br>Man findet sie √ºberall: im l√§ndlichen Bereich genauso wie mitten in den St√§dten.</p><p>Leider geht es den meisten verwilderten Katzen nicht gut. Sie leben unter den widrigsten Bedingungen und m√ºssen sich im kalten Winter durchschlagen. Neben nat√ºrlichen Feinden wie Marder, Hunde, etc.. kommen nat√ºrlich auch noch die Menschen, die die Katzen entweder \"nur\" verjagen, misshandeln oder gar t√∂ten.</p><p>Das Hauptziel des Vereines ist es diesen Katzen zu helfen. Wir kl√§ren √ºber die Entstehung dieser wilden Katzenpopulation auf. Es werden Einfang- und Kastrationsaktionen durchgef√ºhrt, Futterstellen eingerichtet und den Katzen Unterschlupfm√∂glichkeiten bereitgestellt. Unter diesen Bedingungen (Kastration, regelm√§ssiges Futter und trockener und im Winter vor allem warmer Unterschlupf) f√ºhren diese Katzen ein relativ gl√ºckliches Leben.</p><p>Nat√ºrlich gen√ºgt es nicht nur die bereits draussen lebenden Streuner zu kastrieren sondern auch die Menschen davon zu √ºberzeugen auch ihre zutraulichen \"Haus\"katzen zu kastrieren. Wie oft kommt es vor, dass eine Katze, die Besitzer hat, sich in einen Schuppen zur√ºckzieht und dort ihre Babies bekommt und diese aufzieht. Die Kleinen sind Menschen nicht gewohnt und folgen zum Teil gar nicht der Mutter ins \"warme\" zu Hause, sondern gehen bald ihre eigenen Wege und pflanzen sich wiederum fort.</p><p><strong>Jeder, der seine unkastrierte Katze draussen frei herumlaufen l√§sst, tr√§gt zur Entstehung oder Vergr√∂√üerung der verwilderten Katzenpopulationen bei!</strong></p><h2>Team</h2><p>teamfotos und so...</p><h2>Statistik</h2><p>ganz viele zahlen...</p>', NULL, NULL, 1, 1, 7, 0, 0, NULL, 0),
