INSERT INTO `streunerkatzen_contentcomponent` (`ID`, `Content`) VALUES
(2, '<p>Tolle Contentbox</p>'),
(3, '<p>Verein zum Schutz verwilderter Katzen</p>'),
(4, '<p>Zweimal j√§hrlich gibt es eine wahre \"Katzenbabyflut\". Tierfreunde, Tiersch√ºtzer, aber leider auch unverantwortliche Menschen, die ‚Äûeinmal‚Äú Junge haben wollten, versuchen dann die Babies an den Mann zu bringen.<br>Es wird aber von Jahr zu Jahr schwieriger die Kleinen unterzubringen und vor allem so unterzubringen, dass sie einen Platz auf Lebenszeit bekommen.</p><p>Je mehr Katzenbabies vermittelt werden m√ºssen, desto leichtfertiger werden sie meist vermittelt.<span>&nbsp;</span><br>Oft werden die Tiere viel zu fr√ºh von Mutter und/oder Geschwistern getrennt, kommen in Einzelhaft in die Wohnung, etc.. Die Folgen sind:</p><p>- Aggression<br>- Zerst√∂rungswut<br>- St√§ndiges Schreien<br>- Unrein sein</p><p>√úber kurz oder lang m√ºssen sie dann als erwachsene Tiere ein zu Hause finden, da die Besitzer oft mit der Situation √ºberfordert sind und gar nicht den Willen haben sich zu informieren und das Problem an der Wurzel anzupacken. Die Katzen landen dann oft entweder im Tierheim oder bei Tierschutzvereinen. Die wiederum haben dann den Ruf nur ‚Äûgest√∂rte‚Äú Tiere in der Vermittlung zu haben, was eine Vermittlung solcher Tiere nicht gerade f√∂rdert bzw. erleichtert.</p><p>Wenn sie nicht soviel Gl√ºck haben werden sie get√∂tet oder ausgesetzt. Und so schlie√üt sich der Kreis, denn die ausgesetzten Tiere sind oft noch nicht kastriert und bekommen bald selber Nachwuchs.<br>Oder sie entwischen w√§hrend der Rolligkeit oder werden bewusst rausgelassen, weil sie so ‚Äûnerven‚Äú oder die Wohnung vollpinkeln.</p><p>Die Kastration von wilden Katzen, aber auch die Kastration der Katzen die in Privathaushalten leben, ist uns daher ein sehr wichtiges Anliegen. Die Katzenpopulationen vergr√∂√üern sich sonst immer mehr und mehr und es kommt nach einiger Zeit zu Inzucht und daraus resultierenden Krankheiten.</p>'),
(5, '<h4>Vor der Operation</h4><p>Die Katze sollte unbedingt frei von klinischen Krankheitssymptomen sein. In optimalen F√§llen kennt der Tierarzt das Tier von vorangegangenen Untersuchungen im Rahmen von Impfungen und antiparasit√§ren Behandlungen.<br>Unmittelbar vor der Operation darf die Katze nichts fressen, d.h. √ºber einen Zeitraum von 12 Stunden kein Futter zu sich nehmen. Wasser trinken darf sie jedoch sehr wohl.</p><p>Ebenfalls g√ºnstiger f√ºr die Operationssituation ist, wenn die Katzen nicht gerade rollig ist (erh√∂hte Blutungsgefahr)<br>Eine Kastration ist nat√ºrlich trotzdem m√∂glich. Bisher gab es bei unseren Katzen, welche bei der Kastration rollig waren, keinerlei Komplikationen.</p>'),
(6, '<p>Jetzt gibt es aber Menschen, die trotz allem unbedingt Katzenbabies von ihrer Katze haben m√ºssen/wollen. Leider gibt es immer noch einige Irrt√ºmer, die sich hartn√§ckig halten und mit denen wir oft konfrontiert werden:Jetzt gibt es aber Menschen, die trotz allem unbedingt Katzenbabies von ihrer Katze haben m√ºssen/wollen. Leider gibt es immer noch einige Irrt√ºmer, die sich hartn√§ckig halten und mit denen wir oft konfrontiert werden:</p><h4><br>Katzen sollten mind. einmal in ihrem Leben Babys bekommen z.B. weil es f√ºr die ‚ÄûPsyche‚Äú und die Gesundheit der Katze gut ist, einmal geworfen zu haben.</h4><p>Dass Katzen einmal in ihrem Leben Junge bekommen sollen, ist ein weit verbreiteter Irrglaube. Viele der Katzenm√ºtter sind mit ihrem ersten Wurf hoffnungslos √ºberfordert und k√ºmmern sich dann nicht um die Jungen. Diese sterben dann an Unterk√ºhlung oder verhungern, sofern man sie nicht mit der Hand aufzieht. Hat man Gl√ºck und die meist viel zu junge Mami k√ºmmert sich um ihre Babys, ist das nur ihrem angeborenen Instinkt zuzuschreiben und nicht weil sie so eine Freude mit ihren Babys hat. Leider gibt es auch immer wieder Tier√§rzte die den Katzenbesitzern raten, die Katze einmal werfen zu lassen, bevor sie kastriert wird, weil es besser f√ºr Eierst√∂cke und Geb√§rmutter ist. Nun bleibt die Frage, wieso sollte man etwas \"Gutes\" f√ºr Eierst√∂cke und Geb√§rmutter tun? Die Eierst√∂cke werden bei der Kastration entfernt und je nach Tierarzt oder medizinische Notwendigkeit auch die Geb√§rmutter. Was f√ºr einen Sinn hat das also?</p><h4><br>Unsere Kinder sollen einmal das ‚ÄûWunder der Geburt‚Äú erleben und zusehen k√∂nnen wie kleine K√§tzchen aufwachsen und gr√∂√üer werden.</h4><p>Das ‚ÄûWunder der Geburt‚Äú l√§uft nicht immer ohne Komplikationen ab und es kommt nicht selten vor, dass manche Babys in den ersten 2 Wochen sterben oder gleich tot auf die Welt kommen. Sollte die Mutterkatze √ºberfordert sein und sich nicht um ihre Jungen k√ºmmern, hei√üt es: Handaufzucht der Kitten. Das h√∂rt sich allerdings s√º√üer an, als es ist, da die Babys je nach Alter alle 2 ‚Äì 4 Stunden ihre Flasche bekommen m√ºssen, auch in der Nacht! Und es ist nicht gesagt, dass √ºberhaupt alle Kitten √ºberleben.Sp√§testens bei der Umstellung von Muttermilch auf feste Nahrung bekommen die meisten Jungtiere schlimmen Durchfall, da oft zu schnell und auf ungeeignete Futtermittel umgestellt wird.Falls die Kitten √ºberleben, toben sie bald im Haus / in der Wohnung herum und eine kl. Horde spielender Kitten hat jede Menge Unsinn im Kopf. Oft sagen dann Interessenten die vorher unbedingt eines der Babys aufnehmen wollten kurzfristig ab und wohin dann mit den Kleinen?</p><h4><br>Eine M√∂glichkeit \"einmal Katzenbabys\" zu haben oder das Aufwachsen der Kleinen beobachten zu k√∂nnen.</h4><p>Informieren Sie sich ausf√ºhrlich √ºber Tr√§chtigkeit, Geburt und Aufzucht und wenden Sie sich dann an einen Tierschutzverein oder Tierheim. Es gibt leider genug hochtr√§chtige Katzen, die nicht mehr kastriert werden k√∂nnen und die ohnehin Nachwuchs bekommen. Tierschutzvereine und Tierheime w√ºrden durch Unterbringung solcher Katzen auf verantwortungsbewussten und verl√§sslichen Pflegepl√§tzen immens entlastet werden.</p><h4><br>Wir wollen unbedingt Nachwuchs von ‚Äûunserer‚Äú Katze, da diese ganz besonders h√ºbsch ist oder ein ganz besonderes Wesen hat.</h4><p>Hierzu soll gesagt sein: f√ºr die meisten Katzenbesitzer ist die eigene Katze immer die h√ºbscheste, sch√∂nste und hat sowieso DEN Charakter schlechthin. Das hei√üt aber nicht, dass sie diese Eigenschaften auch an ihren Nachwuchs weitervererbt. Unseren Beobachtungen zufolge haben die Kitten von normalen Hauskatzen meist gar nichts oder nur sehr wenig mit der Mutter gemeinsam.<br> Ein gutes Beispiel hierf√ºr war unsere ‚ÄûPenelope‚Äú sie wurde streunend und hochtr√§chtig aufgegriffen. Penelope war eine sehr gelassene, ruhige, angenehme Katze, die durch nichts zu ersch√ºttern war. Die h√ºbsche Tigerkatze brachte dann einen roten Kater, eine schwarzes M√§derl und 2 dreif√§rbige Katzenm√§dchen zur Welt, die allesamt sehr aufgedreht und aufgeweckt waren und weder im Aussehen noch vom Charakter her auch nur ann√§hernd √Ñhnlichkeiten mit Mutterkatze Penelope hatten. Derartige Beispiele haben wir zu Hauf.Weitervererbung von Aussehen und Charaktereigenschaften sind nur bei gezielten Verpaarungen von Rassekatzen zu erreichen. Vor allem deshalb weil hier √ºber Generationen hinweg ein bestimmtes Ziel verfolgt wird. Unsere normalen Hauskatzen verpaaren sich in der Regel mit einem x-beliebigen unkastrierten Artgenossen.</p><h4>Katzen die kastriert sind, werden faul und tr√§ge und fangen nicht mehr so viele M√§use.</h4><p>Kastrierte Katzen werden nur faul und tr√§ge, wenn man ihre Ern√§hrung nicht dem ge√§nderten Stoffwechsel anpasst. Kastrierte Katzen m√ºssen nicht mehr herumstreunen auf der Suche nach einem Partner, sich mit Kontrahenten raufen und sich auch nicht um die Jungenaufzucht k√ºmmern, daher haben sie viel mehr Zeit sich dem M√§usefang zu widmen.Allerdings werden Katzen die vorher keine begnadeten M√§usef√§nger waren auch nachher keine mehr werden. Katzen die hingegen vor der Kastration viele M√§use gefangen haben, werden dies nach der Kastration genauso intensiv betreiben. Au√üerdem sollte man bedenken, dass Katzen mit zunehmendem Alter generell ruhiger werden.</p><h4><br>Wenn alle Katzen kastriert werden, gibt es bald keine normalen Hauskatzen mehr.</h4><p>Es wird niemals m√∂glich sein, alle Katzen zu erwischen zumal es immer noch die richtig wilden Hauskatzen gibt, die sich nur nachts sehen lassen und von denen niemand in der Umgebung wei√ü, dass es sie √ºberhaupt gibt. Es sollte auch bedacht werden, dass viele Tierschutzvereine und Tierheime leider gezwungen sind hochtr√§chtige Streuner kastrieren zu lassen, weil die Babies dieser Katzen absolut keine Chance auf ein vern√ºnftiges zu Hause haben. Die nicht vermittelten Babies w√ºrden wichtige Pflegestellen blockieren und so kann verletzten oder kranken Tieren nicht geholfen werden.</p><h4><br>Der Kater/die Katze soll doch auch seinen/ihren Spa√ü haben</h4><p>Kater streunen kilometerweit um eine rollige Katze zu decken. Sie k√§mpfen oft mit Rivalen und kommen meist, wenn sie nicht auf ihren Streifz√ºgen dem Autoverkehr oder anderen Feinden zum Opfer gefallen sind, abgemagert und √ºbers√§ht mit Wunden zur√ºck. Durch diese K√§mpfe aber auch durch den Deckakt selber k√∂nnen Krankheiten wie z.B. FIV (auch Katzenaids genannt) √ºbertragen werden und die meisten unkastrierten Katzen haben daher eine relativ niedrige Lebenserwartung. Zudem ist der Deckakt alles andere als ein Vergn√ºgen f√ºr die Katze. Auf dem Penis des Katers befinden sich Widerhaken, die beim Herausziehen, der Katze gro√üe Schmerzen bereiten und dadurch den Eisprung ausl√∂sen. Der Kater zieht sich nach dem Deckakt schnell zur√ºck um keine Pr√ºgel zu kassieren. Oben im Bild ein Beispiel eines Katers, wie unkastrierte Kater oft √ºber kurz oder lang aussehen: √ºbers√§ht von Biss- und Kratzwunden, abgemagert, etc..&nbsp;Die Katze/der Kater ist zu alt f√ºr eine Kastration ‚Äì zahlt sich nicht mehr aus<br>Eine Kastration macht immer Sinn, auch von √§lteren Tieren. Katzen k√∂nnen bis ins hohe Alter rollig und entsprechend tr√§chtig werden. Alte, potente Kater haben es mit zunehmendem Alter immer schwerer sich gegen√ºber j√ºngeren Rivalen durchzusetzen und kassieren umso mehr Pr√ºgel und werden verletzt. Das Bild oben zeigt einen Kater aus Hinzenbach, der bei der Kastration mind. 10 Jahre alt war. Das Nachher-Foto wurde etwa ein Jahr nach der Kastration aufgenommen.</p><h4><br>Kater werden kastriert und Katzen sterilisiert</h4><p>Dies ist ein immer noch sehr verbreiteter Irrtum, denn Sterilisation bzw. Kastration definiert nicht ob ein m√§nnliches oder weibliches Tier operiert wird. Katzen werden im Regelfall genauso kastriert wie Kater. Kastration bedeutet n√§mlich das vollst√§ndige Entfernen von Hoden bzw. Eierst√∂cken und je nach Tierarzt bzw. Fortschritt einer ev. Tr√§chtigkeit auch die Entfernung der Geb√§rmutter. Sterilisation bedeutet jedoch nur, dass die Samenleiter beim Kater bzw. die Eileiter bei der Katze durchtrennt werden. Die Tiere bleiben dabei aber sexuell aktiv. Weibliche Katzen werden weiterhin rollig und auch die Kater streunen wochen- und monatelang durch die Gegen um Katzen zu decken.</p><h4><br>Katzen m√ºssen bei der Kastration 3 kg schwer sein</h4><p>Dieses Gewicht wird durchschnittlich mit 6 - 8 Monaten erreicht. Mit dem Alter sind viele Katzen bereits tr√§chtig bzw. Kater markieren oft schon l√§ngst. Nat√ºrlich kann man die Kastration auch schon fr√ºher dh vor der Geschlechtsreife und vor einer willk√ºrlich bestimmten Gewichtsangabe durchf√ºhren. Schlie√ülich k√∂nnen heutzutage bereits auch Nager wie Meerschweinchen, M√§use und Hamster kastriert werden.</p><h4><br>Geschwister verpaaren sich nie!</h4><p>Gro√üer Irrtum! Dem Kater ist es ziemlich egal, ob die rollige Katze seine Schwester oder Mutter oder sonst wie mit ihm verwandt ist. Der Trieb sagt ihm einfach nur, dass er sich mit der rolligen Katze paaren muss, egal wie eng verwandt sie mit ihm ist. Gerade bei Geschwistern w√§re eine Kastration mit sp√§testens 5 Monaten unbedingt anzuraten!</p><h4><br>Die Katze wird ohnehin nie rollig / bekommt sowieso nie Junge.</h4><p>Hier liegt die Ursache oft darin, dass die Katze entweder bereits Ver√§nderungen an der Geb√§rmutter hat (Entz√ºndungen, Vereiterung) oder eine Zysten an den Eierst√∂cken hat. Beides hat √ºber kurz oder lang die Folge, dass die Katze qualvoll daran stirbt. Oft kommt es aber auch vor, dass die Katze unbemerkt tr√§chtig wird (mit nur ein oder 2 Jungen) und dann eine Fehlgeburt hat oder die Kleinen irgendwo zur Welt bringt und nicht versorgt und diese dann sterben.</p>'),
(7, '<p>Katzen und Kater k√∂nnen grunds√§tzlich ab dem 4ten Lebensmonat kastriert werden. Es gibt auch die Fr√ºhkastration, diese wird vor allem in den USA und bei Z√ºchtern, zum Teil aber auch bereits bei Tierschutzorganisationen angewandt. Die Fr√ºhkastration wird im Normalfall zwischen der 8ten und 16ten Woche durchgef√ºhrt.<br>So kann mit abgegebenen Tieren nicht \"gez√ºchtet\" werden.</p><p>Das Durchschnittsalter f√ºr eine Kastration liegt bei etwa<span>&nbsp;</span><strong>4 - 6 Monaten<span>&nbsp;</span></strong>liegen. Bei verschieden geschlechtlichen<span>&nbsp;</span><strong>Geschwisterp√§rchen</strong><span>&nbsp;</span>w√§re anzuraten, beide mit etwa<strong><span>&nbsp;</span>5 Monaten</strong><span>&nbsp;</span>kastrieren zu lassen.<span>&nbsp;</span><br>Eine Katze muss nicht rollig gewesen sein um sie kastrieren zu lassen und auch Kater m√ºssen noch nicht zu markieren anfangen.<br>Die Gefahr, dass die Kater nach der Kastration weitermarkieren, weil sie es schon so gewohnt sind, ist immer gegeben.<br>Rollige Katzen nerven ihren Besitzer nicht nur mit extremer Anh√§nglichkeit sondern auch mit st√§ndigem raunzen, miauen. Rollige Katzen werden zudem sehr erfinderisch wenn es darum geht zu einem potenten Kater zu kommen und sind bereits oft genug Katzen aus dem Fenster gesprungen oder aus der T√ºr entwischt. Man sollte auch bedenken, dass es die sogenannte ‚Äûstille Rolligkeit‚Äú gibt. Hier zeigt die Katze keinerlei Anzeichen f√ºr die Rolligkeit. Der Besitzer merkt also √ºberhaupt nichts davon, sehr wohl aber die Kater in der Umgebung.</p><p>Manche Tier√§rzte behaupten leider immer noch, dass zu fr√ºh kastrierte Kater keinen richtigen Katerkopf bekommen w√ºrden oder kleinw√ºchsig bleiben.<br>Das konnte weder in Studien noch von Seiten der Tierschutzvereine, die √∂fter gezwungen sind j√ºngere Tiere zu kastrieren, best√§tigt werden.<br>Die Gr√∂√üe der Katzen h√§ngt nicht von den Geschlechtshormonen ab, sondern von den Genen und ist bereits vorgegeben. Egal wann die Kastration stattfindet.<span>&nbsp;</span><br>Bei den verwilderten Katzen kastrieren wir ab 4 Monaten, ganz einfach aus dem Grund, weil wir die M√∂glichkeit nutzen m√ºssen, falls eine dieser jungen Katzen in die Falle geht. Wenn wir sie freilassen w√ºrden um sie sp√§ter noch einmal zu fangen, k√∂nnte es bereits zu sp√§t sein.<span>&nbsp;</span><br>Bislang konnten auch wir keine Unterschiede in der Entwicklung bei etwa 4 Monate alten kastrierten Tieren feststellen.</p>'),
(8, '<h4>Nach der Operation</h4><p>Die Katze sollte unbedingt frei von klinischen Krankheitssymptomen sein. In optimalen F√§llen kennt der Tierarzt das Tier von vorangegangenen Untersuchungen im Rahmen von Impfungen und antiparasit√§ren Behandlungen.<br>Unmittelbar vor der Operation darf die Katze nichts fressen, d.h. √ºber einen Zeitraum von 12 Stunden kein Futter zu sich nehmen. Wasser trinken darf sie jedoch sehr wohl.</p><p>Ebenfalls g√ºnstiger f√ºr die Operationssituation ist, wenn die Katzen nicht gerade rollig ist (erh√∂hte Blutungsgefahr)<br>Eine Kastration ist nat√ºrlich trotzdem m√∂glich. Bisher gab es bei unseren Katzen, welche bei der Kastration rollig waren, keinerlei Komplikationen.</p>'),
(9, '<p><span>Um die j√§hrliche Katzenschwemme wenigstens etwas einzubremsen gibt es seit 1.1.2005 eine Kastrationspflicht welche auch im Tierschutzgesetz verankert ist.</span></p><p>Der Gesetzestext lautet:</p><p><em><strong>‚ÄûWerden Katzen mit regelm√§√üigem Zugang ins Freie gehalten, so sind sie von einem Tierarzt kastrieren zu lassen, sofern diese Tiere nicht zur kontrollierten Zucht verwendet werden oder in b√§uerlicher Haltung leben.‚Äú</strong></em></p><p>Aufgrund der Petition bzgl. der Ausnahme von Katzen in b√§uerlicher Haltung die vom Verein ‚ÄûStreunerkatzen O√ñ‚Äú eingereicht wurde, nahm im M√§rz 09 das Bundesministerium f√ºr Gesundheit Stellung: Ausgenommen von der Kastrationspflicht (\"b√§uerliche Haltung\") sind lediglich Tiere, die vielleicht zwar regelm√§√üig auf einem b√§uerlichen Hof mitgef√ºttert werden, aber ansonsten verwildert sind und als Streunertiere leben.<span>&nbsp;</span><strong>Bauern m√ºssen demnach IHRE eigenen Katzen sehr wohl auch kastrieren lassen.</strong><span>&nbsp;</span>F√ºr diese Katzen gelten die gleichen Mindestanforderungen f√ºr die Haltung, wie f√ºr Katzen von Privatpersonen.</p><p>Die Kastrationspflicht wird von Tierschutzvereinen als auch engagierten Privatpersonen kontrolliert und bei Versto√ü zur Anzeige gebracht.<br><strong>Bei Nichteinhaltung der Kastrationspflicht drohen Strafen bis zu ‚Ç¨ 3.750</strong></p><p><strong>Wichtige Information zum Thema</strong></p><p>Katzen k√∂nnen bereits ab etwa 4 Monaten geschlechtsreif werden.<span>&nbsp;</span><strong>Eine Kastration zwischen dem 4. und 6. Lebensmonat ist daher mittlerweile durchaus √ºblich.</strong><span>&nbsp;</span>Die Empfehlung, dass eine Katze erst rollig gewesen sein muss, oder ein Kater erst zu markieren angefangen haben muss, um eine Kastration durchzuf√ºhren zu k√∂nnen ist l√§ngst √ºberholt und veraltet.</p><p>Personen die gerne \"einmal Babies\" h√§tten oder das Aufwachsen der Kleinen beobachten m√∂chten, sollten sich<span>&nbsp;</span><strong>ausf√ºhrlich</strong><span>&nbsp;</span>√ºber Tr√§chtigkeit, Geburt und Aufzucht informieren und sich dann an einen Tierschutzverein oder Tierheim wenden. Es gibt leider genug hochtr√§chtige Katzen, die nicht mehr kastriert werden k√∂nnen und die ohnehin Babies bekommen. Tierschutzvereine und Tierheime w√ºrden durch Unterbringung solcher Katzen auf verantwortungsbewussten und verl√§sslichen Pflegepl√§tzen immens entlastet werden.</p>'),
