(18, '<p>Da wir die eingefangenen Katzen nicht nur kastrieren lassen, sondern auch ev. Krankheiten oder Verletzungen behandeln lassen, sind nat√ºrlich auch einige Tierarztrechnungen zu bezahlen. Aber auch f√ºr Futter, Katzenstreu, Werbemittel, etc ben√∂tigen wir immer wieder finanzielle Unterst√ºtzung.</p><h4>Vereinskonto Streunerkatzen O√ñ</h4><p>Sparda Bank<br>Kto: 24100670000<br>BLZ: 49460</p><p>f√ºr √úberweisungen aus dem Ausland:</p><p><strong>IBAN</strong>: AT694946000002410067<br><strong>SWIFT</strong>: SPDAAT21XXX<br> <br><strong>Paypal</strong>: info@streunerkatzen.org<br> <br>Vielen Dank f√ºr Ihre Spende!</p>'),
(19, '<p>todo: restrukturierung</p><p>SachspendenSachspenden&nbsp;Hier finden Sie Dinge, die wir immer brauchen k√∂nnen, vielleicht haben Sie ja das eine oder andere zu Hause oder Sie k√∂nnen das eine oder andere auch √ºber einen unserer Partnerlinks bestellen. Somit helfen Sie uns gleich doppelt.<br>&nbsp;Kontakt: Sabine Auer, 0699 / 11 91 01 54Sachspenden k√∂nnen auch direkt an unsere Vereinsadresse geschickt werden&nbsp;Katzen&nbsp; Futter - vorzugsweise NassfutterHier nehmen wir gerne auch sehr g√ºnstiges Futter wie z.b. Felix, Shah, Cassedy, Dein Bestes, Molly, .. (z.B. bei zooplus.de speziell f√ºr unsere Wilden, wo es nur darum geht die hungernden M√§ulchen zu stopfen&nbsp; zum p√§ppelnda wir immer wieder abgemagerte/kranke Katzen bei uns zum P√§ppeln haben, brauchen diese nat√ºrlich etwas hochwertigeres um schnell etwas auf die Rippen zu kriegen. Hierf√ºr eignen sich hochwertige Futtermarken und Fl√ºssignahrung wie:Royal Canin Recovery (Fl√ºssignahrung, erh√§ltlich beim Tierarzt)Royal Canin Convalescence Support (Fl√ºssignahrung in pulverform, erh√§ltlich beim Tierarzt)Calopet Paste (bei manchen Tier√§rzten und Apotheken bzw. Online-Shops erh√§ltlich)&nbsp;Animonda, Grau, Bozita, ... (z.B. bei zooplus.de erh√§ltlich)Aufzuchtsmilch (vorzugsweise Gimpet)&nbsp; MedikamenteWir haben auch immer wieder verletzte und kranke Katzen bei uns, f√ºr diese ben√∂tigen wir fast immer:Refobacin Augensalbe / Augentropfen (bitte nur neu und nicht abgelaufen)Accular (Augentropfen)Aqua Tears (Augentropfen)K√§spappelteeMilbemax (Entwurmungstabletten, f. Katzen u. kleine Katzen)Drontal (Entwurmungstabletten)Advocate (Flohmittel)Frontline spot on (Flohmittel)Surolan (Ohrenreiniger)&nbsp; Decken und alte Handt√ºcherk√∂nnen ruhig L√∂cher haben, werden nur zum not√ºrftigen Auspolstern der vor√ºbergehenden Unterschl√ºpfe verwendet<br>&nbsp; Katzenstreuvon uns bevorzugte Streu ist die Cat¬¥s Best √ñko Plus, da sie ist sehr sparsam im Verbrauch ist und man mit einem Sack sehr lange auskommt.<br>&nbsp;Baumaterialien (f√ºr Unterschl√ºpfe)&nbsp; ausgediente H√§ngek√§stchen oder Hundeh√ºttendiese werden von uns zu trockenen und halbwegs warmen Unterschl√ºpfen f√ºr die verwilderten Katzen umgebaut<br>&nbsp; Styroporzum d√§mmen der H√§ngek√§stchen und Hundeh√ºtten<br>&nbsp; wasserfeste Folie und Lackedienen dazu um die Unterk√ºnfte wasserdicht und trocken zu gestalten<br>&nbsp;Reinigungsmittel&nbsp; Waschmittel (Pulver u. fl√ºssig)da wir immer wieder Pfleglinge zum gesundpflegen oder auch tr√§chtige Katzen aufnehmen, m√ºssen die Unterlagen und Kuschelh√∂hlen regelm√§ssig gewaschen werden um eine Ausbreitung von Krankheiten zu verhindern.<br>&nbsp; PutzmittelNat√ºrlich m√ºssen Boden, aber auch Futtersch√ºsseln und Transporter immer wieder gereinigt werden. Daher nehmen wir auch immer wieder gerne:Geschirrsp√ºlmittelBodenreiniger&nbsp;ATTA&nbsp;&nbsp; Desinfektionsmittelist besonders bei unseren kranken Pfleglingen wichtig&nbsp;&nbsp;Sonstiges&nbsp; Papier, wei√ü und buntf√ºr Ausdrucke von Aush√§ngen, Flyern, Brosch√ºren, Schreiben, etc..&nbsp;&nbsp; Toner&nbsp;f√ºr Farblaserdrucker Canon i-sensys LBP5000&nbsp; Briefmarken&nbsp; Tankgutscheine</p>'),
