(21, '<p>TODO: restrukturierung</p><p>Eine weitere M√∂glichkeit uns zu unterst√ºtzen gibt auf verschiedenen Webseiten. Hier erhalten wir Pro Klick oder pro Einkauf finanzielle Unterst√ºtzung.Eine weitere M√∂glichkeit uns zu unterst√ºtzen gibt auf verschiedenen Webseiten. Hier erhalten wir Pro Klick oder pro Einkauf finanzielle Unterst√ºtzung.<br>&nbsp;&nbsp;Qualit√§t f√ºr Katze und Hund Pro g√ºltig abgeschlossener Bestellung erhalten wir 5,5 % des Bestellwertes.Angeboten werden Artikel f√ºr Katze und Hund aus den Bereichen Spielzeug, Training, Transport, Premiumnahrung und Nahrungserg√§nzung, Aufzucht- und Medizinbedarf bis hin zu Bachbl√ºten, Trinkbrunnen und Profi-Pflegeartikeln.&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;F√ºr Bestellungen √ºber den links angef√ºhrten Link erhalten wir 4 % des Nettoumsatzes aller Artikel, die √ºber diesen Link gekauft wurden.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; F√ºr Bestellungen √ºber den links angef√ºhrten Link erhalten wir 5 % des Nettoumsatzes aller Artikel, die √ºber diesen Link gekauft wurden. Ab 11 Artikel erhalten wir 5,25 %&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;Weinshop mit pers√∂nlichem Weinetikett Pro Bestellung erhalten wir hier 10 % Provision.Wein aus √ñsterreich mit individuell gestaltbarer Etikette.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;www.fressnapf.de F√ºr die Anmeldung √ºber den links angef√ºhrten Link erhalten wir 1000 Tatzen gutgeschrieben.Weiters kann man seine Tatzen, die man gesammelt hat (durch Einrichten einer Seite, Beitr√§ge im Forum, etc..) einem Tierheim oder Verein spenden.Spenden an Vereine und Tierheime werden grunds√§tzlich in f√ºnffacher H√∂he auf dem Tatzenkonto gutgeschrieben.Wir haben dann die M√∂glichkeit die Tatzen gegen einen Gutschein einzutauschen um diesen dann in einem der Fre√ünapfm√§rkte einzul√∂sen.Info: 10 Tatzen haben einen Wert von 1 Cent<br>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; F√ºr jeden Amazon.de Geschenkgutschein, den wir vermitteln, verdienen wir pauschal 6% vom jeweiligen Gutscheinwert. Die Werbekostenerstattung wird verg√ºtet f√ºr Verk√§ufe, die direkt √ºber Geschenkgutschein-Links von unserer Webseite generiert werden UND √ºber Geschenkgutscheine, die nach dem Anklicken von anderen Amazon.de Produkten gekauft wurden.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; F√ºr jeden Amazon.de DVD-Verleih - Neukunden erhalten wir 12 EUR Pr√§mie.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>www.&nbsp;GO!Domain, Webspace, www.sprit.orgPro Abfrage bekommen wir 5 Cent gutgeschrieben. Aus Sicherheitsgr√ºnden werden nur unterschiedliche (unique) IP-Adressen als Klick gewertet.&nbsp;(Link l√§sst sich leider nicht in einem neuen Fenster √∂ffnen :-( , aber wir arbeiten daran)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Beim Abonnieren der Zeitschrift \"Herz f√ºr Tiere\", \"Geliebte Katze\", \"Partner Hund\" oder \"Aquarium live\" √ºber links angef√ºhrten Link erhalten wir pro abgeschlossenem Abo eine Provision von 15 % des Nettopreises.</p>'),
(22, '<p>TODO: formular mitgliedschaft</p><p><strong>Hinweise bzgl. Mitgliedschaft:</strong></p><p>(*) Ordentliche Mitglieder sind jene, die sich voll an der Vereinsarbeit beteiligen und/oder sich mit den Zielen des Vereines identifizieren k√∂nnen. Ordentliche Mitglieder k√∂nnen alle Personen nach Vollendung des 14. Lebensjahres oder juristische Personen sein, bei Minderj√§hrigen ist zus√§tzlich die Unterschrift des gesetzlichen Vertreters erforderlich.<br><br>(**) Wir planen die Gr√ºndung einer Jugendgruppe: Ziel soll sein gerade Kinder und Jugendliche f√ºr das Problem der unkastrierten Katzen zu sensibilisieren.</p><p><strong>Zahlung Mitgliedsbeitrag:</strong><br>Sp√§teste Zahlungsfrist f√ºr den Mitgliedsbeitrag ist der 31. J√§nner eines jeden Gesch√§ftsjahres.</p><p><strong>Austritt aus dem Verein:</strong><br>Der Austritt kann nur zum 31. Dezember jeden Jahres erfolgen. Er muss dem Vorstand mind. 2 Monate vorher schriftlich mitgeteilt werden. Erfolgt die Anzeige versp√§tet, so ist sie erst zum n√§chsten Austrittstermin wirksam. F√ºr die Rechtzeitigkeit ist das Datum der Postaufgabe ma√ügeblich.</p>'),
(23, '<p>TODO Patenschaft formular</p><p>&nbsp;</p><p>Mit einer Patenschaft unterst√ºtzen Sie die Finanzierung von Kastrationen und tier√§rztlichen Behandlungen von verwilderten Katzen.<br>Als Pate k√∂nnen Sie sich jederzeit bei uns melden um ein oder auch mehrmals zu einer Fangaktion mitzukommen um sich vor Ort ansehen zu k√∂nnen, was Sie mit ihrem Beitrag unterst√ºtzen.</p>'),
(24, '<p>Leider gibt es sehr viele mehr oder weniger gro√üe verwilderte Katzenpopulationen. Wir versuchen so gut als m√∂glich diese Populationen in Schach zu halten bzw. das Vergr√∂√üern dieser Populationen mittels Kastrationen zu verhindern.Leider gibt es sehr viele mehr oder weniger gro√üe verwilderte Katzenpopulationen. Wir versuchen so gut als m√∂glich diese Populationen in Schach zu halten bzw. das Vergr√∂√üern dieser Populationen mittels Kastrationen zu verhindern.</p><p>Einige der Katzen k√∂nnen jedoch nicht wieder an ihre angestammten Pl√§tze zur√ºck, weil sie entweder unerw√ºnscht oder dort in Gefahr sind.</p><p>Daher suchen wir dringend Bauernh√∂fe, Reitst√§lle, Schreberg√§rtenbesitzer, Privatpersonen mit Haus und Garten, etc.., die mind. 2 scheue Katzen aufnehmen k√∂nnen.</p><p>Die Katzen br√§uchten nur:</p><ul>\n<li>1 x t√§glich gef√ºttert werden</li>\n<li>einen trockenen Unterschlupf (entweder eine Scheune, Kellerraum, Gartenh√§uschen, etc...)</li>\n</ul><p><strong>Die Katzen werden kastriert, augenscheinlich gesund und kostenlos bzw. gegen eine kleine Spende abgegeben.</strong></p><p>Die Katzen werden gebracht. F√ºr die ersten Wochen empfiehlt es sich, wenn diese Katzen in einem geschlossenen Raum (Gartenh√ºtte, Garage, Keller, etc..) untergebracht werden um sich an die neue Umgebung und die neue Futterstelle zu gew√∂hnen.</p><p>Wenn Sie interessiert sind, dann wenden Sie sich bitte an Sabine Auer, 0699 / 11 91 01 54</p>'),
(25, '<p>TODO: Blogartikel zu Kategorien</p><ul>\n<li>Berichte / Fangen</li>\n<li>Infoecke (zur Katzenhaltung, ...)</li>\n<li>Schicksale</li>\n<li>Was tun, wenn...</li>\n<li>Veranstaltungen</li>\n</ul>'),
(27, '<p>S√§mtliche Inhalte, Fotos, Bilder, Texte oder Layout dieser Webseiten sind urheberrechtlich gesch√ºtzt. Es ist untersagt, diese ohne ausdr√ºckliche Genehmigung von Sabine Auer zu kopieren oder auf andere Weise zu verbreiten. <br>Copyright ¬© 2004 - 2019 Sabine Auer. All rights reserved.</p>'),
